import React from 'react'
import { useContext } from 'react'
import { useState } from 'react'
import './Login.css'
import { AppContext } from './Context'
import { useNavigate } from 'react-router-dom'

const Login = () => {
    const navigate = useNavigate()
    const {userInfo,setUserInfo} = useContext(AppContext)
    const [loginInfo,setloginInfo] = useState()
   const handleSubmit =(data)=>{
      setloginInfo(data)
       if(userInfo.Cpassword === loginInfo.Cpassword && userInfo.email === loginInfo.email)
       {
          navigate('dashboard')
       }else
           return <section>
              <p>Either user </p>
           </section>

   } 
  return (
    <div className='Login'>

        <h2 className='Login__title'>Login</h2>
    <form className='Form' onSubmit={handleSubmit}>
         <div className='form__fields'>
            <label className='form__label'>Email</label>
            <input type='email' placeholder='Email' name='email' className='form__inputs' autoComplete='off'/>
        </div>
        <div className='form__fields'>
            <label className='form__label'>Password</label>
            <input type='password' placeholder='Password' name='password'  className='form__inputs' autoComplete='off'/>
        </div>
        <button className='button__login'>Login</button>



    </form>
 </div>
  )
}

export default Login
